// HasMenuFromParent applies the HasEdge predicate on the "menu_from_parent" edge.
func HasMenuFromParent() predicate.CoreMenu {
	return predicate.CoreMenu(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, MenuFromParentTable, MenuFromParentColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasMenuFromParentWith applies the HasEdge predicate on the "menu_from_parent" edge with a given conditions (other predicates).
